import { CleanButton } from "../../Styled_Components/Buttons";
import { FilterButtonLine } from "../../Styled_Components/filterButtonLine";
import {
  GridCards,
  PageCenterStyle,
} from "../../Styled_Components/gridPagesStyles";
import data from "../../../data/resturants.json";
import ChefCard from "../../Cards/ChefCard/ChefCard";
const ChafPage = () => {
  return (
    <PageCenterStyle>
      <FilterButtonLine>
        <CleanButton>All</CleanButton>
        <CleanButton>New</CleanButton>
        <CleanButton>Most Viewed</CleanButton>
      </FilterButtonLine>
      <GridCards>
        {data.chef.map((chef) => {
          return (
            <ChefCard
              img={chef.img}
              firstName={chef.firstName}
              lastName={chef.lastName}
            />
          );
        })}
      </GridCards>
    </PageCenterStyle>
  );
};
export default ChafPage;
